import './App.css';
import React, { useState } from 'react';


function App() {

	const [notes, setNotes] = useState([1, 2, 3, 4, 5]);
	const [editNum, setEditNum] = useState(null);

	const result = notes.map((note, index) => {
		return <p key={index} onClick={() => setEditNum(index)}>
			{note}
		</p>;
	});

}
export default App;
